import React from 'react'
import { Link } from "react-router-dom";

export default function Navbar() {
    return (
        <ul>   
     <nav className='Nav'> 
        <li> 
        <Link to="/">Home</Link>
        </li>
        <li> 
        <Link to="/APropos">Apropos</Link>
        </li>
     </nav>
     </ul>
    )

}
